import React, { Component } from 'react';

import { Container, Button, Card } from 'react-bootstrap';
import CardDeck from 'react-bootstrap/CardDeck'

class Far extends Component {
    state = { 
        name: "nasir",
        bttext: "I am a big button"
     };


    render() { 
        return ( 
        <div>
            <CardDeck>Hello</CardDeck>
            <Container fluid>
            <Button variant="outline-success">{this.state.name}</Button>{' '}
            </Container>
        </div>
        );
    }
}

export default Far;
